;; **
;;; ### Gabor filter encoder
;; **

;; @@
(require '[htm-mnist.encoders :as mnist-enc] :reload)

(def debug-image-encoder
  (mnist-enc/gabor-encoder [28 28] gf-specs
                          {:threshold 100
                           :juxtapose? true}))

(def image-encoder
  (mnist-enc/gabor-encoder [28 28] gf-specs
                          {:threshold 100}))

(table-view
  (for [inval (train-inputs 8)]
   [(table-view
      (for [gf gf-bank]
       [(<img> (gabor/gaborize
                 (imgs/bytes->image (:img-bytes inval) [28 28] gf-pad) gf)
               84)]
     ))
    (viz debug-image-encoder (:img-bytes inval) {:max-height-px 2000, :bit-h-px 4, :bit-w-px 4})
    (viz image-encoder (:img-bytes inval) {:bit-h-px 24, :bit-w-px 2})
    ])
)

