;; **
;;; ## HTM model - single layer global
;; **

;; @@
(def spec
  {:column-dimensions [1000]
   :global-inhibition? true
   :depth 1
   :lateral-synapses? false
   :distal {:learn? false}
   :proximal {:perm-inc 0.01
              :perm-dec 0.01}})

(def model (core/regions-in-series
            1 core/sensory-region
            [spec] {:input [:img-bytes thresh-encoder]}))

(time
  (def trained-1k
    (reduce p/htm-step model (train-inputs 1000))))

;; @@
;; ->
;;; read 784016 bytes
;;; file has 60000 images at 28 x 28
;;; file has 60000 labels
;;; &quot;Elapsed time: 19111.286 msecs&quot;
;;;
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/trained-1k</span>"}
;; <=

;; **
;;; ### Receptive fields
;; **

;; @@
(let [lyr (get-in trained-1k [:regions :rgn-0 :layer-3])]
  (for [col (range 20)]
    (let [inbits (keys (core/cells-proximal-bit-votes lyr [[col 0]]))]
      (viz idx-thresh-encoder inbits {:bit-w-px 2, :bit-h-px 2}))))
