;; **
;;; ## HTM model - direct, single layer, local
;; **

;; @@
(def loc-spec
  {:column-dimensions [30 30]
   :global-inhibition? false
   :ff-potential-radius (float (/ 5 28))
   :ff-init-frac 1.0
   :depth 1
   :lateral-synapses? false
   :distal {:learn? false}
   :proximal {:perm-inc 0.01
              :perm-dec 0.01}})

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/loc-spec</span>"}
;; <=

;; @@
(def this-loc-spec (assoc loc-spec :inhibition-base-distance 3))

(def loc-model (core/regions-in-series
            1 core/sensory-region
            [this-loc-spec] {:input [:img-bytes thresh-encoder]}))

(time
  (def loc-trained-1k
    (reduce p/htm-step loc-model (train-inputs 1000))))
;; @@
;; ->
;;; read 784016 bytes
;;; file has 60000 images at 28 x 28
;;; file has 60000 labels
;;; &quot;Elapsed time: 13518.481 msecs&quot;
;;;
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/loc-trained-1k</span>"}
;; <=

;; @@
(let [lyr (get-in loc-trained-1k [:regions :rgn-0 :layer-3])]
  (for [col (->> (range 20) (map #(* % 900/20)))]
    (let [inbits (keys (core/cells-proximal-bit-votes lyr [[col 0]]))]
      (viz idx-thresh-encoder inbits {:bit-w-px 2, :bit-h-px 2}))))
