;; **
;;; ### Evaluate on training data
;; **

;; @@
(time
(def results30k
(doall
  (for [inval (train-inputs fg-indices 1000)]
    (try
      (let [htm (p/htm-step super-trained-30k (dissoc inval :label))
          guess (->> (core/predictions htm :label 1 p/active-cells)
                     (first)
                     :value)
          class-cell (-> (get-in htm [:regions :class :layer-3])
                         (p/active-columns) (first))]
      {:actual (:label inval)
       :decoded guess
       :class-cell class-cell})
      (catch Exception e
        {:actual (:label inval)})))))
  )

