(def hist-actual
  (frequencies (map :actual results30k)))

(def hist-guessed
  (frequencies (map :decoded results30k)))

(def confusion30k
  (frequencies (map #(select-keys % [:actual :decoded]) results30k)))

(def class-hists
  (->> results30k
       (map #(dissoc % :decoded))
       (group-by :class-cell)
       (util/remap frequencies)))

(pprint class-hists)

[

["class-cell"
 (table-view
   (for [class-i (range 10)
         :let [hist (get class-hists class-i)]]
     [(str "cell " class-i)
      (plot/bar-chart (range 10)
                      (map (fn [i] (get hist {:actual i, :class-cell class-i}))
                           (range 10))
                      :plot-size 180)]))]

["actual"
 (plot/bar-chart (range 10) (map hist-actual (range 10))
                 :plot-size 240)
 ]

["guessed"
 (plot/bar-chart (range 10) (map hist-guessed (range 10))
                 :plot-size 240)
 ]

(table-view
  (for [actual (range 10)]
    (into
      [actual]
      (for [guessed (range 10)]
        (get confusion30k {:actual actual, :decoded guessed}))))
    :columns (into ['_] (range 10)))

["error rate:"
 (let [n (reduce + (vals confusion30k))
       nok (reduce + (vals (select-keys confusion30k (map (fn [i] {:actual i, :decoded i})
                                                          (range 10)))))]
   [(- n nok) "/" n])
 ]

